import React, {useState} from "react";
import SpaceXLaunches from "./SpaceXLaunches";

const App = () => {
    const [sortArg, setSortArg] = useState(-1);
    return (
        <div className="App">
            <select
                onChange={(change) => setSortArg(Number(change.target.value))}
            >
                <option value={-1}>Сначала последние</option>
                <option value={1}>Сначала первые</option>
            </select>
            <div>
                <SpaceXLaunches sortArg={sortArg}/>
            </div>
        </div>
    )
};

export default App;
